import { Environment } from '../app/models/environment.model';

export const environment: Environment = {
  production: false,
  youtubeConfig: {
    defaultSearchOptions: {
      order: 'viewCount' as const,
      videoDefinition: 'high' as const,
      maxResults: 12,
      regionCode: 'IN',
      relevanceLanguage: 'ml',
      category: 'cinema' // default category
    },
    categories: [
      {
        id: 'cinema',
        name: 'Cinema',
        videoCategoryId: '1', // Film & Animation
        searchParams: {
          q: 'malayalam full movie',
          videoDuration: 'long',
          minViewCount: 100000,
          order: 'date',
          category: 'cinema'
        }
      },
      {
        id: 'food',
        name: 'Food',
        videoCategoryId: '26', // Howto & Style
        searchParams: {
          q: 'malayalam food vlog cooking',
          minViewCount: 25000,
          order: 'viewCount',
          category: 'food'
        }
      },
      {
        id: 'music',
        name: 'Music',
        videoCategoryId: '10', // Music
        searchParams: {
          q: 'malayalam new songs',
          minViewCount: 50000,
          order: 'date',
          category: 'music'
        }
      },
      {
        id: 'news',
        name: 'News',
        videoCategoryId: '25', // News & Politics
        searchParams: {
          q: 'malayalam news latest',
          order: 'date',
          publishedAfter: 'today',
          category: 'news'
        }
      },
      {
        id: 'tech',
        name: 'Technology',
        videoCategoryId: '28', // Science & Technology
        searchParams: {
          q: 'malayalam tech podcast startup interview',
          minViewCount: 10000,
          videoDuration: 'long',
          order: 'viewCount',
          category: 'tech'
        }
      }
    ]
  }
};
